import React, { useState } from "react";
import "./App.css";
import Category from "./components/Category";
// ---------------- REACT ---------------------//

// VARIABLES 

// let url = "https://sheetsu.com/apis/v1.0bu/05c2c5a08ead";
let url = "./data.json";
const App = () => {


  // -----  GLOBAL STATES
  const [data, setData] = useState([]);

  // -----  fetching data
  fetch(url)
    .then((res) => res.json())
    .then((res) => console.log(res))
    .then(res => {
      setData(res)
    })
    .then(() => console.log(data))


  // -----  USER interface
  return data.length === 0 ?
    (<div> loading { data.length} </div>)
    : (<div className='container'>
      <div className="row">
        Logo here
        </div>
      <div className="row">
        <Category data={data} />
      </div>
    </div>)
};
export default App;
